window.bookSummaryJSON = "<p>Gaming with friends offered what Amanda missed in her dreary college life: friendship and excitement, the thrill of combat for a good cause, and the chance to be a hero. Neither Amanda nor her friend, Eric, ever expected to face the suddenly real world of their fantasy adventures. But when a careless joke draws the ire of a dark wizard, both must rise to the challenge. </p><p>Leveling up has never been so hard...or felt so good. </p><p>WARNING: <i>Days of High Adventure</i> contains graphic violence, graphic premarital sex, graphic violation of college housing regulations, rampant geekery, multiple dismemberments, impalings, bad language, nudity, drug references, consumption of alcohol, destruction of private property, paganism, theft, arson, slavery, reptile-on-human violence, improper placement of hazardous materials, money laundering, illegal immigration, tax evasion, poor workplace standards, unwed cohabitating couples, kidnapping, assault under color of authority, bearers of false witness, human sacrifice, desecration of religious sites, unsafe work standards, uncredited film quotes, and references to games falsely accused of Satanic influences. There may be dungeons and/or dragons herein. </p>"; 
